    return (
      <a id='RecipeCardLink' href={sourceUrl} style={{textDecoration: "none", color: "inherit"}}>
        <Card as='RecipeCard' style={{ width: "300px", height: "400px", borderRadius:0}}>
          <img variant="top" src={image} style={{objectFit: "cover"}}/> {/* Replace with "image" from api */}
          <Card.Body>
            <Card.Subtitle as="subtext" style={{ margin: "10px" }}>{dishType}</Card.Subtitle> {/* Replace with "dishType" from api */}
            <div></div>
            <Card.Title as="recipeTitle" style={{ margin: "10px" }}>{title}</Card.Title> {/* Replace with "title" from api */}
            <svg width="20" height="20" viewBox="0 0 20 20" fill="none" xmlns="http://www.w3.org/2000/svg" >
<rect width="20" height="20" fill="url(#pattern0)"/>
